import React from 'react';
import Events from './components/Event';
import Header from './components/Header';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

function App() {
  return (
    <div className="App">
     <Header branding="Event Finder"/>
     <div className="container">
    <Events/>
     </div>
    </div>
  );
}

export default App;
